--------------------------------------------------------
--  DDL for View VW_GB_ASIGNACION
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "DANIEL"."VW_GB_ASIGNACION" ("ID_ASIGNACION", "ID_BECA", "CONVOCATORIA", "MODALIDAD", "ID_CARRERA", "CARRERA", "ID_IES", "IES", "TIPO_GESTION", "TIPO_IES", "ID_SEDE_ESTUDIO", "REGION", "SEDE", "ID_ASESOR", "ASESOR") AS 
  select  asig.id_asignacion,
        b.id_beca,
        b.convocatoria,
        b.modalidad,
        c.id_carrera,
        c.descripcion carrera,
        i.id_ies,
        i.nombre ies,
        tg.descripcion tipo_gestion,
        ti.descripcion tipo_ies,
        sd.id_sede_estudio,
        sd.region,
        sd.sede,
        ase.id_asesor,
        ase.nombre asesor
from gb_asignacion asig
inner join gb_carrera c
  inner join gb_beca b
  on c.id_beca = b.id_beca
on asig.id_carrera = c.id_carrera
inner join gb_sede_estudio sd
  inner join gb_ies i
    inner join gb_tipo_gestion tg
    on i.id_tipo_gestion = tg.id_tipo_gestion
    inner join gb_tipo_ies ti
    on i.id_tipo_ies = ti.id_tipo_ies
  on sd.id_ies = i.id_ies
on asig.id_sede_estudio = sd.id_sede_estudio
inner join gb_asesor ase
on asig.id_asesor = ase.id_asesor;
--------------------------------------------------------
--  DDL for View VW_GB_BECA_CARRERA
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "DANIEL"."VW_GB_BECA_CARRERA" ("ID_BECA", "CONVOCATORIA", "MODALIDAD", "INICIO", "TERMINO", "ID_CARRERA", "CARRERA", "SEMESTRE_EGRESO") AS 
  select  b.id_beca, b.convocatoria, b.modalidad, b.inicio, b.termino,
        c.id_carrera, c.descripcion carrera, c.semestre_egreso
from gb_beca b
inner join gb_carrera c
on b.id_beca = c.id_beca;
--------------------------------------------------------
--  DDL for View VW_GB_BECARIO
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "DANIEL"."VW_GB_BECARIO" ("ID_BECARIO", "DNI", "NOMBRES", "APELLIDOS", "SEXO", "ID_ASIGNACION", "ID_BECA", "CONVOCATORIA", "MODALIDAD", "CARRERA", "IES", "TIPO_GESTION", "TIPO_IES", "REGION", "SEDE", "ASESOR", "ID_ESTADO", "ESTADO") AS 
  select  b.id_becario, b.dni, b.nombres, b.apellidos, b.sexo,
        a.id_asignacion,
        a.id_beca,
        a.convocatoria,
        a.modalidad,
        a.carrera,
        a.ies,
        a.tipo_gestion,
        a.tipo_ies,
        a.region,
        a.sede,
        a.asesor,
        e.id_estado,
        e.descripcion estado
from gb_becario b
inner join vw_gb_asignacion a
on b.id_asignacion = a.id_asignacion
inner join gb_estado e
on b.id_estado = e.id_estado;
--------------------------------------------------------
--  DDL for View VW_GB_IES_CARRERA_SEDE
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "DANIEL"."VW_GB_IES_CARRERA_SEDE" ("ID_IES", "IES", "TIPO_GESTION", "TIPO_IES", "ID_SEDE_ESTUDIO", "REGION", "SEDE") AS 
  select  i.id_ies, i.nombre ies,
        tg.descripcion tipo_gestion,
        ti.descripcion tipo_ies,
        sd.id_sede_estudio,
        sd.region,
        sd.sede
from gb_ies i
inner join gb_tipo_gestion tg
on i.id_tipo_gestion = tg.id_tipo_gestion
inner join gb_tipo_ies ti
on i.id_tipo_ies = ti.id_tipo_ies
inner join gb_sede_estudio sd
on i.id_ies = sd.id_ies;
